// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
contract Test{
    struct Price{
        uint256 hello;
        // this will store how many decimal there are from returned decimals() of Chainlink Data Feed
        uint8 decimalNum;
    }

    Price public mytest;
    //mytest.heloo will have the value in USD but it's not decimal, so mytest.decimalNum will tell us how many 
    //numbers there are after the decimal point, example if mytest.hello is "186727554117" and mytest.decimal is "8"
    //then the final value should be "1867.27554117"
    // i added 1e10 to match the returned value number size to be like 1e18, normally, 1 ETH = 1e18 Wei
    // so we should multiply "1867.27554117" with 1e10 or 1**10 that means adding 10 zeros after the 8 numbers "27554117"
    // NOTE that msg.value is uint256
    // so we need to convert the value to uint256
    function setMytest() public{
        (,int256 price,,,) =AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e).latestRoundData();
        mytest.hello = uint256(price * 1e10);
        mytest.decimalNum=AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e).decimals();
    }
}

